INSERT INTO public.topic (id, created_at, updated_at, session_id, name, description, speaker, location) VALUES ('6452eec0-dda1-4720-b8b8-ea3c8b809e20', '2020-07-10 16:39:00.686172+00', '2020-07-10 16:39:00.686172+00', '23be9727-56ad-4e76-b2ad-957fe97f21b1', 'Jak odkryć i rozwijać powołanie', 'Powołanie niezależne od sytuacji. Mamy naturalne talenty, charakter kształtujemy a otwiera drzwi Bóg. Jak wykorzystać dobrze czas w różnych okresach.', 'Ewa Kamińska', NULL);
INSERT INTO public.topic (id, created_at, updated_at, session_id, name, description, speaker, location) VALUES ('6826cd7e-bea9-444a-8537-68b85527ce2b', '2020-07-10 22:44:29.673876+00', '2020-07-11 18:19:19.925197+00', '23be9727-56ad-4e76-b2ad-957fe97f21b1', 'Wartości jakimi się kierujesz , kultura jaką tworzysz', 'Progresywna, efektywna i nieprzypadkowa służba. Wartości tworzą kulturę. Kultura atmosferę. Czy świadomie wybierach tą hierarchię? Czy na spotkaniach tworzysz tylko atmosferę, czy dbasz o ponadczasową kulturę Królestwa?', 'Karol Michalak', NULL);
INSERT INTO public.topic (id, created_at, updated_at, session_id, name, description, speaker, location) VALUES ('4c5c2ad9-19eb-4802-9750-757089994929', '2020-07-11 18:20:23.167348+00', '2020-07-11 18:20:23.167348+00', '23be9727-56ad-4e76-b2ad-957fe97f21b1', 'Dary Ducha Świętego - jak rozbudzać i używać', 'Dary ducha Świętego na spotkaniu, w służbie, w duszpasterstwie. Jak rozbudzić jak używać.', 'Marek Kamiński', NULL);
INSERT INTO public.topic (id, created_at, updated_at, session_id, name, description, speaker, location) VALUES ('e3ea03cd-b4ba-473b-a525-62127cd167a1', '2020-07-11 18:26:04.364791+00', '2020-07-11 18:26:04.364791+00', 'f8d001cb-c2e2-41fc-9955-6dc038570af3', 'To, co robisz jest kluczowe', 'Wywieranie wpływu na młodych ludzi to budowanie kościoła. Twój wpływ nie sięga grupy, a całej społeczności teraz i na przyszłość. Masz wpływ na przyszłych przywódców kościoła.', 'Marek Kamiński', NULL);
INSERT INTO public.topic (id, created_at, updated_at, session_id, name, description, speaker, location) VALUES ('b4f7723e-fe9f-43f6-b1a3-fdfef2cdbdd7', '2020-07-11 18:26:15.44075+00', '2020-07-11 18:26:15.44075+00', 'f8d001cb-c2e2-41fc-9955-6dc038570af3', 'Wizja odwiedzialnością lidera', 'Wizja nie jest dodatkiem, a najważniejszym elementem służby, który pomoże Ci poprowadzić grupę w jednym kiedunku. Odpowiedzialnością lidera jest dbać o aktualność wizji. Lider musi komunikować ją na każdym kroku.', 'Wiktor', NULL);
INSERT INTO public.topic (id, created_at, updated_at, session_id, name, description, speaker, location) VALUES ('aaf4b619-509c-4147-8865-93c3c172125e', '2020-07-11 18:26:30.27487+00', '2020-07-11 18:26:30.27487+00', 'f8d001cb-c2e2-41fc-9955-6dc038570af3', 'Jak komunikować zmiany', 'Świadomy swoich decyzji. Jak konfrontować swoje decyzje? Z kim? Jak komunikować zespołowi zmiany.', 'Agnieszka Michalak', NULL);
