INSERT INTO public.topic (id, created_at, updated_at, session_id, name, description, speaker, location) VALUES ('41c791b8-30c9-4919-8212-f3c21fb48c27', '2020-07-11 18:31:12.610634+00', '2020-07-11 18:31:12.610634+00', 'd721fe1e-97bc-4ec1-aadf-4b9133eb5b6a', 'Rozpoznaj swoje obdarowanie', 'Liderzy którzy są i pozostaną. Skąd mam wiedzieć ile będę prowadził młodych?', 'Karol Michalak', NULL);
